import Layout from 'components/Layout'
import { Provider, useSelector } from 'react-redux';
import './App.css';
const App=({Component})=> {
  return (
    <div className="App">
      <header className="App-header">
        <Layout/>
        <Router/>
      </header>
    </div>
  );
}

export default App;
